    header: {
        backgroundColor: 'transparent',
        position: pos.position,
        top: 0,
        fontSize: fonts.font_44sp,
        fontFamily: fonts.primary,
        fontWeight: 'bold',
        color: 'black',
        textAlign: 'center',
      },
});

export default TransferPage;
